import React from 'react'
import Carrousel from './components/Carrousel'
import {Carrouseldata} from './components/Carrouseldata'

function Home() {
    return (
        <div className='home'>
            <Carrousel slides={Carrouseldata}/>
        </div>
    )
}

export default Home
